"title": "Handmade Jewelry & Supplies, Upcycled Vintage & More",
"announcement": "Handmade jewelry & supplies, upcycled vintage & contemporary finds including rustics & primitives, vintage beads & findings, tin fridge magnets hand made using real vintage labels and more. Please visit my other shops for more freshly picked quality vintage from New York, with love. International shoppers welcome!  ",
"currency_code": "USD",
