"login_name": "TheRejeweler",
"accepts_custom_requests": true,
"policy_welcome": "Regards from New York, home of the original &quot;Mad Men&quot; of Madison Avenue, and welcome to TheRejeweler by Apple Picker Vintage!  All items in this shop are handmade or upcycled / repurposed by me using the finest quality vintage and contemporary materials available.  Please browse the shop, enjoy the gorgeous slideshows, and ask any question you&#39;d like.  I know you will find something to treasure whether you are searching for a memorable gift, planning your wedding, or collecting the beautiful, quality vintage and handmade items you love.",
"policy_payment": "You may pay for your items via PayPal or through Etsy&#39;s Direct Checkout using a credit card, debit card, or Etsy Gift Card.  You do not need a PayPal account to use PayPal!  Just select &quot;PayPal&quot; and check out as a guest.  \r\n\r\nNew York residents and/or New York shipping addresses are subject to sales tax.  If you are a NY resident or are shipping to a NY address, you may message me with the destination county before checkout for an updated invoice with proper sales tax calculated, or if you prefer you may check out without messaging me.  In that event, I will message you with the balance due and you may remit via PayPal to complete your order.  Sales tax unpaid within 48 hours of invoice will result in cancellation and relisting of the item.\r\n\r\nPrices are firm.  I cannot respond to conversations asking for coupons or discounts.  Thank you for your understanding!  Please see below for information on combined shipping discounts.\r\n\r\nCUSTOM ORDERS are welcome!  Please message me if you would like to discuss placing a custom order.  At this time, handmade tin fridge magnets are $4 each regardless of quantity, and you supply the original artwork and printed sheets for processing.  Currently, I am not set up to handle printing.  ",
"policy_shipping": "International shoppers are very welcome!  Listing prices include USPS First Class International mail including tracking and insurance.  USPS Priority International shipping upgrade is available at an additional cost.  Buyers are responsible for all duties, customs, fees and taxes levied by their own country and these fees (if any) are not included in the listing or shipping costs.\r\n\r\nInternational and domestic: combining shipping is encouraged to save you money!  Combined shipping rates for single transactions are included in the listings.\r\n\r\nI normally ship twice a week via USPS.  Unless otherwise stated, all orders are processed and mailed within 5-10 business days.  Delivery dates, however, are not guaranteed by myself or by the USPS for any service other than Express (Overnight) Service* available at an extra cost, please message me if you desire this optional shipping upgrade.  With the exception of items purchased with the Express shipping upgrade, your order will be processed and shipped in the order received.  All items ship from Long Island, New York.  Please see listings for shipping costs.\r\n\r\nLOST OR DAMAGED PACKAGES:  I have your back!  All items are insured through the USPS or a 3rd party carrier, or are self-insured by me.  I carefully and competently package all items, however...if your package arrives damaged, or if it has not arrived at all after 30 days, please message me right away to assist in the insurance claims process.  Please be aware that time limitations for insurance claims do apply, so do not hesitate!  After the claim has been timely completed and submitted, I will refund you directly for the purchase price plus original shipping.  Damaged items require close up and wide angle photographs of the outside of the package, the inside packing materials, the damaged item and the address label.  Lost item claims may require a notarized affidavit and/or federal mail theft charge to be filed.\r\n\r\n* Guaranteed delivery, in the case of USPS Express Overnight service, means that your item is guaranteed to be delivered within 1 or 2 business days of timely mailing.  The only remedy for late delivery is a refund from the USPS to the buyer of postage paid.  Buyer is responsible for procuring any refund directly from the USPS.  Please see below for the return policy of this shop, including returns of items shipped with USPS Express and delivered late.",
"policy_refunds": "Except in cases of damage or defects as noted below, all sales are final.\r\n\r\nTo maintain quality inventory and to ensure that you receive exactly what you pay for, I maintain possession and control of every item until it is placed in the mail to you.  Because no one else handles the merchandise, and because I do not accept returns and exchanges, I can guarantee that that sterling silver is real sterling, vintage beads and findings are authentic, etc. and that your items have not been previously used; handled, stored or cleaned improperly; or had pieces removed or switched out for inferior materials.\r\n\r\nI stand by the quality of my workmanship and materials and the honesty and integrity of my photographs and descriptions.  Therefore, I offer refunds or exchanges in the unlikely event of defective workmanship or materials, incorrect item sent, or damage during shipping only.  If you believe I have materially or grossly misrepresented an item in the listing, and you are not happy with it, please message me.",
"policy_additional": "All items are stored in my smoke-free home.  \r\n\r\nIf you desire to clean your items upon receipt, please use care and research proper cleaning methods to preserve condition and avoid damage.\r\n\r\nVery minor &quot;flaws&quot; including as-manufactured flaws are to be expected in quality vintage items and may not be described in the listing; however, if I notice something unusual on inspection I will do my best to describe it accurately. \r\n\r\nDisclaimer and legal statement: all items are offered for sale in their found, secondhand condition and no warranties exist, express or implied, including warranty of merchantability and warranty for a particular purpose. All items are offered as collectors&#39; items for adults only. Buyers&#39; sole remedy against seller is the return policy as outlined above. Buyers must be 18 years of age or older. Use of this site constitutes your agreement to these terms. Thank you!\r\n\r\nPlease see my other stores at https://www.etsy.com/shop/ApplePickerVintage and https://www.etsy.com/shop/EveryDayLingerie for more quality hand picked vintage.  Thank you for supporting this small business!\r\n",
