"description": "A beautiful original 1926 Prohibition Prescription for Spirits Frumenti, the US pharmaceutical term for Whiskey...O (pint)...Sig. Directed! This prescription was the fourth issued and is the largest and quite ornate. Please see photos!\r\n\r\nFrom the days of Al Capone, speakeasies and moonshine this was the only legal way to drink liquor in the US!\r\n\r\nThis prescription has poppies on the top corners, fleur-de-lys on the bottom, and spider-webbed borders!\r\n\r\nThe whiskey was prescribed for Mrs. Mary Bolger, by Dr. Francis P. McCormick, on April 30, 1926, and was filled on May 4, 1926, by Fahey&#39;s Pharmacy in Ithaca, NY.\r\n\r\nIt was printed by the US Treasury Department on beautiful paper, that was also used for US currency. In the center is the old Treasury Seal with the Latin inscription, &quot;Thesaur. Amer. Septent. Sigil.&quot;. When you hold this prescription up to the light, PROHIBITION is watermarked, as with the metal strips that are used in U.S. bills today, the graphics are GREAT!\r\n\r\nThe prescription measures 6 1/2&quot; x 5 3/4&quot;, has a bend along the top, left border, a tiny spindle hole and one clipped corner (to void), otherwise, condition is excellent....a great script from New York&#39;s Prohibition!\r\n\r\nThis is a FANTASTIC piece of history and would be great to display in a pharmacy, museum, wine cellar, bar or office! I am happy to answer any questions you may have and thank you for your interest!\r\n \r\nAll items ship within 24 hours and I will contact you when I receive notification of any purchase, thank you! :)",
