"creation_tsz": 1202351209,
"title": "Handmade Modern Jewellery Vintage Style Jewelry Acrylic",
"announcement": "Handmade modern jewelry and vintage style jewellery, acryclic paintings and pencil drawings.  Sometimes you never have to say a word to make a statement, other times a picture (painting or drawing) is worth a thousand words and for the rest of the time spell it out for them with personalized jewelry.\r\n\r\nThank you for visiting and supporting handmade.\r\n\r\nPlease go to my policies for shipping and return information.\r\n\r\nJoin me on \r\nTwitter - @bellissimadesig\r\nFacebook - https://www.facebook.com/BellissimaDesigns\r\n\r\nProud member of the Alberta Street Team - find us all by searching &quot;Alberta Team&quot;",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for shopping at Bellissima Designs and I hope you enjoy your purchase.  Please check back often as I will be adding new stuff all the time.  Please take a moment to complete the etsy feedback on your item so I can better serve you.",
"digital_sale_message": null,
"last_updated_tsz": 1408408562,
"listing_active_count": 37,
"login_name": "BellissimaDesigns",
"accepts_custom_requests": true,
"policy_welcome": "Welcome! My name is Sherri and I am a jewelry designer, pencil and acrylic painting artist. All the pieces you will find here have been created by me. \r\n\r\nI offer unique, contemporary, spiritual, and personalized jewellery designs. My drawings are of items involved with the sea as I have an incredible affinity for the ocean.  My paintings are modern, abstract, silhouettes of things you find in the world around you.  I have started personalizing the paintings also so they are perfect for baby showers, wedding showers and gifts, birthdays, graduations, and any occasion you want to customize.\r\n\r\nI take special care to ensure everything is of the outmost quality and that each piece is unique. I value every customer and try to make each transaction as pleasant as possible. \r\n Have an amazing day!\r\nSherri",
"policy_payment": "At this time I only accept Paypal.\r\n\r\nYou can pay securely through PayPal with your debit or credit card, even if you don&#39;t have an account.\r\n",
"policy_shipping": "If you would like me to ship to an address other than the one on your paypal account PLEASE note that in shipping instructions and mention that it is not your paypal address.\r\nI ship worldwide and keep my shipping prices accurate for what it will cost me to mail the item(s) to you. If there is a difference larger than $1, I will refund you the difference through paypal.\r\n\r\nPackages are usually mailed within:\r\n3-4 business days for ready-to-ship items.\r\n2+ weeks for custom made items.  I will let you know when your custom item is ready to be shipped through a convo.\r\n\r\nTypically, packages going to a Canadian destination will take about 3-7 business days to arrive.  Please take into account the production time which does not include the shipping time.\r\n\r\nInternational shipping generally takes about 5-10 business days, but in rare cases can be up to a month depending on customs.  The buyer will be responsible for any and all duties and/or taxes that are charged.  Please take into account the production time which does not include the shipping time.\r\n\r\nI ship via Canada Post Small Packet, unless otherwise specified in the listing. I am not responsible for any lost or missing packages.\r\n\r\n\r\nUpgrading:\r\nIf you would like your shipping upgraded to Express (which is usually faster and comes with a tracking number) please let me know at the time of purchase. Express post is $12 US (this number is instead of what the item listing states for shipping).\r\n\r\nI would really like to ensure that you are happy with your purchase so please email, convo and/or leave me feedback when you receive it.  Thank you :)\r\n",
"policy_refunds": "If you are not satisfied with your product do not hesitate to let me know.  I am happy to refund or exchange the item for a full refund less any shipping costs within 10 days of receipt, as long as the product is in it&#39;s original condition.  If you would like I can attempt to repair the item instead of sending you a refund, as long as all pieces are returned and you are responsible for the shipping charges.  If I cannot repair it I will send you a full refund less any shipping costs.",
"policy_additional": "If you would like me to make you a matching item to something you have purchased from me, please contact me and I will see what I can do.\r\nIf you are interested in an item I sell but in a different color, please contact me and I will do my best to accomodate you.\r\n\r\nI will happily do custom orders just convo me :)",
