"title": "Sweet Leaf Vinyl (Used, Rare, and Vintage Records)",
"announcement": "After silence, that which comes nearest to expressing the inexpressible is music.\r\n-Aldous Huxley\r\n\r\nI am a musician, and have been an esteemed vinyl collector for over 20 years.  All my albums are graded visually, and in some cases, played to ensure quality.\r\n\r\nMy goal is to bring these beautiful vintage, and rare gems to your turntable, and from your turntable, into your heart. \r\n\r\nAll records are priced based on rarity, and then quality of the actual product for sale.  I want you to have the vinyl you want for the cheapest price available.  I have 1000&#39;s of records unlisted, so please ask about anything you don&#39;t see.\r\n\r\nVintage Fans!  ...check out my wife&#39;s Vintage shop &quot;Sweet Leaf Vintage&quot; at: http://www.etsy.com/shop/sweetleafvintage\r\n\r\nROCK ON!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Your business makes us wanna dance!\r\nWe hope this vinyl spinnin&#39; on your phonograph makes you wanna too!!!\r\nThank You!!! \r\nPeace, Love, and Music!",
"digital_sale_message": null,
"last_updated_tsz": 1411685985,
