"login_name": "victorforesta",
"accepts_custom_requests": true,
"policy_welcome": "My Grading System:\r\n\r\nThe vinyl, and sleeve condition will always be described first, noting all flaws, shrinkwrap, cut-outs, etc.\r\n\r\nVinyl grading is as follows:\r\n\r\nSEALED: Exactly that. 100% factory sealed, unopened, unplayed.\r\n\r\nMint: Only used in the rarest of occasions. Opened, but most likely unplayed-no spindle marks. Flawless.\r\n\r\nNear Mint: Close to the above. Perhaps unplayed, really excellent condition.\r\n\r\nNM- Near Mint -: The is the most common grade I use. Minimally played with literally one surface/storage mark or less.\r\n\r\nVG++ Very Good ++: also minimally played, no more than 5 superficial surface/storage marks. Will play beautifully.\r\n\r\nVG+ Very Good+: 5 or more surface/storage/handling marks. Moderate play wear. Playback will still be clear with little to no surface noise/cracks/pops.\r\n\r\nVG Very Good: This grade is for highly collectible titles only. I don&#39;t usually carry much in this grade. Lots of play wear/surface marks. There will be surface noise/pops/crackles, perhaps a skip or two.\r\n\r\n*PLEASE NOTE: Price is always adjusted accordingly for condition no matter the rarity of the title.*\r\n\r\nREASONABLE offers are considered, feel free to &#39;convo&#39; me with your request.\r\n\r\nAll orders ship PROMPTLY upon receipt of cleared payment.\r\n\r\nRecords ship in sturdy cardboard boxes with bubble wrap or cardboard mats to ensure a safe delivery!\r\n\r\nUS orders are shipped via Media Mail with Delivery Confirmation. Please allow up to 7-14 days for delivery. If you would like your LP(s) shipped via PRIORITY Mail, please add an ADDITIONAL $5.00 to your payment, or wait for an updated invoice. PRIORITY REQUESTS ALWAYS ANSWERED PROMPTLY!\r\n\r\nInternational orders are shipped via First Class International Mail. Please allow 1-3 weeks for delivery.\r\n",
"policy_payment": "Payment is by Paypal (preferred), Money Order, or Ca$h (at your own risk) only. \r\n\r\nMoney Orders must be received within 7 business days of purchase date. I will issue a 24 hour payment reminder if I have not heard from you in 2 days of the sale. If no response is received, the transaction will be cancelled and the title will be re-listed.\r\n\r\nI am a very reasonable person, and I know that sh*t happens from time to time. If you are having difficulty meeting the payment policy, please contact me--I&#39;m sure we can work it out.\r\n\r\n~all Paypal payments are to be made to victorforesta@gmail.com",
"policy_shipping": "Your inspiration ships 1-2 business days after payment is received!\r\n\r\nAll L.P.&#39;s are shipped via Media Mail with Delivery Confirmation within the US only. Insurance is optional but available for an additional $2.00.\r\nIf you would like your LP shipped via Priority Mail, please add $5 to your payment, or wait for an adjusted invoice. I will always answer Priority requests promptly.\r\n\r\nInternational shipping is via First Class International Airmail. If you would like a faster method, please contact me for a price quote.\r\n\r\n",
"policy_refunds": "As always, please contact me FIRST if you have ANY problems or questions with your order. I want you to be happy with your purchase, and pleasantly surprised with the condition & packing. I am only human, and we do all make mistakes, but again, with communication, we can surely work out any issue that may arise.",
